import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCloud } from '@fortawesome/free-solid-svg-icons';
import { faMusic } from '@fortawesome/free-solid-svg-icons';
import { faCalendar } from '@fortawesome/free-solid-svg-icons';
import { faGear } from '@fortawesome/free-solid-svg-icons';
import { faDesktop } from '@fortawesome/free-solid-svg-icons';
import { faTimes } from '@fortawesome/fontawesome-svg-core';

const Menu = () => {
    return(
        <div id="menu">
            <div class="toggle"><FontAwesomeIcon icon={ faTimes }/></div>
            <li style={{"--i" : 0}}>
                <div><FontAwesomeIcon icon={ faCloud }/></div>
            </li>
            <li style={{"--i" : 1}}>
                <div><FontAwesomeIcon icon={ faMusic }/></div>
            </li>
            <li style={{"--i" : 2}}>
                <div><FontAwesomeIcon icon={ faCalendar }/></div>
            </li>
            <li style={{"--i" : 3}}>
                <div><FontAwesomeIcon icon={ faGear }/></div>
            </li>
            <li style={{"--i" : 4}}>
                <div><FontAwesomeIcon icon={ faDesktop }/></div>
            </li>
        </div>
    )
};

export default Menu;
